import Row from "./Row";
import Banner from './Banner';
import Navbar from './Navbar';
import requests from "./requests";
import firebase from "firebase";
require("dotenv").config();

const firebaseConfig = {
  apiKey: "AIzaSyCC6qpKXLYzZCIfwZL8e-T73lWJ43ovYdc",
  authDomain: "netflix-clone-466c9.firebaseapp.com",
  projectId: "netflix-clone-466c9",
  storageBucket: "netflix-clone-466c9.appspot.com",
  messagingSenderId: "506338378555",
  appId: "1:506338378555:web:8d9b0960c040bf9faaad1e"
};
firebase.initializeApp(config);

function App() {
  return (
    <div className="app">
      <Navbar/>
      <Banner/>
      <Row
        title="Netflix Originals"
        fetchUrl={requests.fetchNetflixOriginals}
        isLargeRow
      />
      <Row title="Trending Now" fetchUrl={requests.fetchTrending} />
      <Row title="Top Rated" fetchUrl={requests.fetchTopRated} />
      <Row title="Action" fetchUrl={requests.fetchActionMovies} />
      <Row title="Comedy" fetchUrl={requests.fetchComedyMovies} />
      <Row title="Horror" fetchUrl={requests.fetchHorrorMovies} />
      <Row title="Romance" fetchUrl={requests.fetchRomanceMovies} />
      <Row title="Documentaries" fetchUrl={requests.fetchDocumentaries} />
    </div>
  );
}

export default App;
